pub fn run_actix_server(engine: Engine<(), ()>) { let sys = System::new("warpgrapher-quickstart"); let app_data = ActixServerAppData { engine: engine }; HttpServer::new(move || { App::new() .data(app_data.clone()) .route("/graphql", web::post().to(graphql)) .route("/graphiql", web::get().to(|| { HttpResponse::Ok() .content_type("text/html; charset=utf-8") .body(playground_source(&"/graphql")) })) }) .bind("127.0.0.1:5000") .expect("Failed to start server") .run(); let _ = sys.run();
